import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <h1>AAA</h1>
    )
  }

  componentDidMount() {
    fetch("https://pokeapi.co/api/v2/pokedex/kanto/")
      .then(result => result.json())
      .then(pokedex => {
        console.log(typeof pokedex.pokemon_entries);
      })
  }
}

export default App;
